  true,\n\t\"url\": null,\n\t\"notes\": \"The Urban Place GIS Coverage of Mexico is
  a vector based point Geographic Information System (GIS) coverage of 696 urban places
  in Mexico. Each Urban Place is geographically referenced down to one tenth of a
  minute. The attribute data include time-series population and selected census/geographic
  data items for Mexican urban places from from 1921 to 1990. The cartographic data
  include urban place point locations on a state boundary file of Mexico. This dataset
  is produced by the Columbia University Center for International Earth Science Information
  Network (CIESIN) in collaboration with the Instituto Nacional de Estadistica Geografia
  e Informatica (INEGI) and the Environmental Research Institute (ERI) of Michigan.\",\n\t\"license_title\":
